        fmt.Println("Cold")
    } else if (degrees >= 12 && degrees < 15) {
        fmt.Println("Cool")
    } else if (degrees >=15 && degrees <= 20) {
        fmt.Println("Mild")
    } else if (degrees > 20 && degrees < 26) {
        fmt.Println("Warm")
    } else if (degrees >= 26 && degrees <= 35) {
        fmt.Println("Hot")
    } else {
        fmt.Println("unknown")
    }
}

